// Import the React and ReactDOM libraries 
import ReactDOM from 'react-dom';
import { Link, Route, HashRouter, Switch } from 'react-router-dom';
import './style.scss';
import React, { Component } from 'react';
import AboutUs from './aboutUs';
import Footer from './footer';
import NavBar from './NavBar';
import House from './houses';
import Investments from './investments';
import Button from './buttons';
import ContactUs from './contactUs';
import faker from 'faker';

class App extends Component {
  render(){
    return(
      <>
        <HashRouter>
        <img src={faker.image.logo()} />
          <h1>Puget Sound Investments</h1>
          <img src={faker.image.avatar()} />
          <div className="App">
            <NavBar />
            <Switch>
              <Route exactly component={AboutUs} pattern="/aboutUs"/>
              <Route exactly component={House} pattern="/house" />
              <Route exactly component={Investments} pattern="/investments" />
              <Route exactly component={ContactUs} pattern="/contactUs" />
            </Switch>
          </div>
          <img src="../assets/house.jpg" alt="house"></img> 
          <Button />
          <Footer />
        </HashRouter>
      </>
      )
    }
  }

  // Take the react component and show it on the screen 
  ReactDOM.render(
      <App />, 
    document.querySelector('#root')
    );



